import React from 'react';
import "./Navbar.css"
export const Navbar = () => {
    return (
        <div class="navbar">
            <p class="Admin-Title">Booking System</p>
            <div>
                <p> Administrador </p>
                <p> Fotito </p>
            </div>
        </div>
    )
}
